import React from 'react';
import { Typography, Grid, Paper, Box} from '@material-ui/core';
import styles from './Header.module.css';
import ProfilePic from './linkedin.jpeg';

function Header() {
    return (
        <div>
            <Grid>
                <Box boxShadow={1} className={styles.header} textAlign="center" fontWeight="bold" display="flex">
                    <img src={ProfilePic} alt="profile"/>
                    <div className={styles.ty}>
                        <Typography className={styles.name} variant="h2">Jamal Dabas</Typography>
                        <Typography className={styles.para} color="textSecondary" variant="p">
                            A software engineer with a passion for developing powerful backends and beautiful frontends
                        </Typography>
                    </div>
                </Box>
            </Grid>
        </div>
    );
}

export default Header;
